import React from 'react'

export const CreatePage = () => {
    return (
        <div className="row">
            <div className="col s8 offset-s2" style={{ paddingTop: '2rem' }}>
                <input
                    id="email"
                    type="text"
                    name="email"
                    onChange={changeHandler}
                />
                <label htmlFor="email"></label>
            </div>
        </div>
    )
}
